
// 3086. Minimum Moves to Pick K Ones
// https://leetcode.com/problems/minimum-moves-to-pick-k-ones/






/* at the beginning of the game we determine aliceIndex. Alice remains at that index!
 * If nums[aliceIndex] == 1, we pick that 1 and nums[aliceIndex] becomes 0;
 * action type 1:
 *     Select any index j != aliceIndex such that nums[j] == 0 and set nums[j] = 1.
 *     This action can be performed at most maxChanges times.
 *     observation: It is always best to do that to the position next to aliceIndex.
 * action type 2:
 *     Select any two adjacent indices x and y (|x - y| == 1) such that nums[x] == 1, nums[y] == 0,
 *     then swap their values (set nums[y] = 1 and nums[x] = 0).
 *     If y == aliceIndex, Alice picks up the one after this move and nums[y] becomes 0.
 *     In other words: We can move a 1 to aliceIndex.
 *     example
 *       A          aliceIndex = 1
 *     0 1 2 3 4 5
 *     0 0 0 0 0 1
 *     It will take 4 actions of type 2 to harvest the 1 that is at index 5 -> 2 moves
 *
 * it is beneficial to deploy action type 1 before harviesting any 1's in a distance > 2
 *         A        aliceIndex = 2
 *     0 1 2
 *     1 0 0
 *     it will take 2 actions of type 2 to harvest the 1 that is at index 0 -> 2 moves
 *     it will take 1 action of type 1 (j == 1, numes becomes 1 1 0) and
 *         one action of type 2 to havest the 1 that is at index 1          -> 2 moves
 *           A      aliceIndex = 3
 *     0 1 2 3
 *     1 0 0 0
 *     it will take 2 actions of type 3 to harvest the 1 that is at index 0 -> 3 moves
 *     it will take 1 action of type 1 (j == 2, numes becomes 1 0 1 0) and
 *         one action of type 2 to havest the 1 that is at index 2          -> 2 moves
 *
 * to pick a 1 at index i it takes abs(aliceIndex - i) actions of type 2
 */
class Solution {
public:
    long long minimumMoves(vector<int>& nums, int k, int maxChanges) {
        // maxChanges + sum(nums) >= k, in other words:
        // it is guaranteed, that we can pick k ones

        int nums_sz = nums.size();
        vector<long long > oneindicies;
        for(int i = 0; i < nums_sz; ++i)
            if( nums[i] == 1 )
                oneindicies.push_back((long long)i);

        int n = oneindicies.size();

        // edge case: we don't have any 1's
        // creating a 1 and picking it takes 2 moves
        if( n == 0 )
            return k * 2LL;

        // edge case: we have 1 1
        // we harvest the only 1 for 0 moves
        // the remaining ones: creating a 1 and picking it takes 2 moves
        if( n == 1 )
            return (k-1) * 2LL;

        long long ans = LLONG_MAX;

        // let us try to pick k ones with the one at aliceIndex,
        // and the adjacent 1's of aliceIndex if any and maxChanges
        for(int i = 0; i < n; ++i) { // i == aliceIndex
            int adjacent = 0;
            if( i > 0 && oneindicies[i] - oneindicies[i-1] == 1 )
                ++adjacent;
            if( i < n-1 && oneindicies[i+1] - oneindicies[i] == 1)
                ++adjacent;

            if( k == 2 && adjacent == 2 )
                adjacent = 1;
            if( maxChanges >= k - 1 - adjacent )
                ans = min(ans, max(0LL, (long long)adjacent + ((k - 1 - adjacent) * 2LL)));
        }
        if( ans != LLONG_MAX )
            return ans;

        // we know we will in all cases use our maxChanges
        long long moves = maxChanges * 2LL;

        // we only need a window with (k - maxChanges) 1's (sliding window of length k - maxChanges)
        // we need to find the optimal window
        k = k - maxChanges;
        int i = 0;                      // left index
        int j = 0;                      // right index
        // initial window of length k
        int mid = (k-1)/2;        // aliceIndex
        for(; j < k; ++j)
            moves += abs(oneindicies[mid] - oneindicies[j]);

        ans = min(ans, moves);
        ++i;

        for(; j < n; ++j) {
            mid = i + ((j-i)/2);

            int nbr_lft = mid - i; // nbr of indicies in window to the left of mid
            int nbr_rgt = j - mid; // nbr of indicies in window to the right of mid

            int cur = oneindicies[mid];
            int pre = oneindicies[mid-1];

            moves = moves - cur * (nbr_rgt - nbr_lft + 1) + pre * (nbr_rgt - nbr_lft - 1) + oneindicies[i-1] + oneindicies[j];
            ans = min(ans, moves);

            ++i;
        }

        return ans;
    }
};




